@import "../node_modules/scss-reset/src/scss/_reset.scss";

.container {
	display: flex;
	max-width: 90vw;
	flex-wrap: wrap;
	gap: 10px;
	position: relative;
}

.modal {
	display: none;
	z-index: 100;
	position: fixed;
	width: 100vw;
	height: 80vh;
	background-color: grey;

	&__container {
		display: flex;
		align-items: center;
		justify-content: center;
		max-width: 70%;
		margin: 0 auto;

		img {
			max-width: 35vw;
		}
	}
}

.country-card {
	margin: 1rem;
	width: 320px;

	background-color: rgb(224, 214, 214);
	border: 1px solid black;
	display: flex;
	flex-direction: column;

	&__wrapper {
		flex: 1;
	}

	&__flag {
		width: 100%;
		height: 200px;
		cursor: pointer;
		object-fit: cover;

		display: block;
	}

	&__info {
		flex: 1;
		padding: 1rem;
	}

	.name {
		font-size: 1.3rem;
		font-weight: 700;
	}

	* > p {
		font-size: 0.9rem;
		margin-top: 0.5rem;
		font-weight: bold;
	}
}
